import * as React from "react";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import ButtonBase from "@mui/material/ButtonBase";
import Typography from "@mui/material/Typography";
import gear1 from "./assets/images/gear1.jpg";
import gear2 from "./assets/images/gear2.jpg";
import gear3 from "./assets/images/gear3.jpg";
import gear4 from "./assets/images/gear4.jpg";
// import gear5 from "./assets/images/gear5.jpg";

import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import ImageListItemBar from "@mui/material/ImageListItemBar";

export default function TitlebarBelowImageList() {
  return (
    <Box
      sx={{
        width: "90%",
        maxWidth: "1080px",
        margin: "auto",
      }}
    >
      <ImageList sx={{ margin: "auto" }}>
        {itemData.map((item) => (
          <ImageListItem key={item.img}>
            <img
              src={`${item.img}?w=248&fit=crop&auto=format`}
              srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
              alt={item.title}
              loading="lazy"
            />
            <ImageListItemBar
              title={item.title}
              subtitle={<span> {item.subtitle}</span>}
              position="below"
            />
          </ImageListItem>
        ))}
      </ImageList>
    </Box>
  );
}

const itemData = [
  {
    img: gear1,
    title: "Camera Body",
    subtitle: "Sony A7iii",
  },
  {
    img: gear2,
    title: "Glass",
    subtitle: "Sony 70-200mm F4, Sigma 35mm F1.4, Laowa 16mm F4",
  },
  {
    img: gear3,
    title: "2021 Macbook Pro 16in i9",
  },
  {
    img: gear4,
    title: "iPad Pro",
  },
];
